INSERT INTO `problems` (`problemId`, `problemName`, `problemDescription`, `inputDescription`, `outputDescription`, `constraintDescription`, `inputExample`, `outputExample`, `notes`, `cpuTimeLimit`, `memoryLimit`, `userId`, `problemAddedDate`) VALUES
(1, ' A + B', '<p>You are given two integer A and B. Find summation of A and B .</p>\n', 'You will be given an integer&nbsp;<strong>T</strong>&nbsp;(<span class=\"equation\">\\(1\\leq T \\leq 10^3\\)</span>) in the first line. In next T lines there will be two integer <strong>A,B</strong>&nbsp;(<span class=\"equation\">\\(1\\leq A,B \\leq 10^{12}\\)</span>).', 'For each test case, print the summation of <strong>A</strong> and <strong>B</strong>.', '<span class=\"equation\">\\(1\\leq T \\leq 10^3\\)</span><br />\n<span class=\"equation\">\\(1\\leq A,B \\leq 10^{12}\\)</span>', '3<br />\n1 2<br />\n2 3<br />\n4 5', 'Case 1: 3<br />\nCase 2: 5<br />\nCase 3: 9', '', 1.4, 12800, 1, '2020-01-24 00:00:00'),
(3, 'Bangladesh Strong In Math', 'hello bangladesh', 'hi', '', '', '', '', '', 0.2, 128000, 7, '2020-02-27 16:44:11'),
(10, 'Bangladesh Play', '<p>Write a program which reads a rectangle and a circle, and determines whether the circle is arranged inside the rectangle. As shown in the following figures, the upper right coordinate&nbsp;(W,H)(W,H)&nbsp;of the rectangle and the central coordinate&nbsp;(x,y)(x,y)&nbsp;and radius&nbsp;rr&nbsp;of the circle are given.</p>\n\n<p><br />\n<img alt=\"Circle inside a rectangle\" src=\"http://judge.u-aizu.ac.jp/onlinejudge/IMAGE2/circle_and_rectangle.png\" /></p>\n\n<p>&nbsp;</p>\n', 'Five integers&nbsp;WW,&nbsp;HH,&nbsp;xx,&nbsp;yy&nbsp;and&nbsp;rr&nbsp;separated by a single space are given in a line.', 'Print &quot;Yes&quot; if the circle is placed inside the rectangle, otherwise &quot;No&quot; in a line.', '<span class=\"equation\">\\(-100 \\leq x,y \\leq 100\\)</span><br />\n<span class=\"equation\">\\(0 &lt; W,H,r \\leq 100\\)</span>', '5<br />\n4<br />\n2<br />\n2<br />\n1', 'Yes', '', 3, 12800, 1, '2020-03-01 23:19:11'),
(11, 'Sum Two Number', '', '', '', '', '17', '128<br />\n132<br />\n144', '', 2, 128000, 1, '2020-03-17 11:58:59'),
(23, 'à¦¸à§à¦Ÿà§à¦°à¦¿à¦‚ à¦à¦° à¦—à§à¦¨', '<p><span class=\"equation\">\\(x = {-b \\pm \\sqrt{b^2-4ac} \\over 2a}\\)</span><br />\n<br />\nà¦†à¦¶à¦¾ à¦•à¦°à¦¿ à¦†à¦®à¦°à¦¾ à¦¸à¦¬à¦¾à¦‡ à¦œà¦¾à¦¨à¦¿ Palindrome à¦•à¦¿ à¦œà¦¿à¦¨à¦¿à¦¸à¥¤ à¦¯à§‡à¦¸à¦¬ String à¦•à§‡ à¦‰à¦²à§à¦Ÿà¦¾ à¦•à¦°à§‡ à¦ªà§œà¦²à§‡à¦“ à¦à¦•à¦‡ à¦¥à¦¾à¦•à§‡ à¦¸à§‡à¦—à§à¦²à¦¾à¦•à§‡ Palindrome à¦¬à¦²à§‡à¥¤ à¦†à¦° Palindromic Tree à¦¹à¦² à¦à¦•à¦Ÿà¦¾&nbsp;<strong>Linear-size</strong>&nbsp;string data structure à¦¯à§‡à¦‡à¦Ÿà¦¾ à¦•à§‹à¦¨ String à¦à¦° à¦¸à¦®à¦¸à§à¦¤ Palindromic sub-string-à¦ à¦¦à§à¦°à§à¦¤ Access à¦•à¦°à¦¾à¦° à¦¬à§à¦¯à¦¬à¦¸à§à¦¥à¦¾ à¦•à¦°à§‡ à¦¦à§‡à§Ÿà¥¤ à¦à¦‡à¦Ÿà¦¾ Formally &ldquo;EERTREE&rdquo; à¦¨à¦¾à¦®à§‡ à¦ªà¦°à¦¿à¦šà¦¿à¦¤à¥¤ à¦à¦‡ Tutorial à¦®à§‚à¦²à¦¤&nbsp;<a href=\"https://codeforces.com/profile/MikhailRubinchik.ru\">MikhailRubinchik.ru</a>&nbsp;à¦à¦°&nbsp;<a href=\"https://arxiv.org/pdf/1506.04862.pdf\">&ldquo;EERTREE: An Efficient Data Structure for Processing Palindromes in Strings&rdquo;</a>&nbsp;- paper à¦à¦° à¦‰à¦ªà¦°à§‡ à¦­à¦¿à¦¤à§à¦¤à¦¿ à¦•à¦°à§‡ à¦¹à¦¬à§‡à¥¤</p>\n\n<h3><strong>Prerequisites</strong></h3>\n\n<ul>\n <li>Basic Trie à¦¸à¦®à§à¦ªà¦°à§à¦•à§‡ à¦§à¦¾à¦°à¦¨à¦¾ à¦¥à¦¾à¦•à¦¾ à¦²à¦¾à¦—à¦¬à§‡à¥¤ (Must)</li>\n <li>Suffix Link à¦¸à¦®à§à¦ªà¦°à§à¦•à§‡ à¦§à¦¾à¦°à¦£à¦¾ à¦¥à¦¾à¦•à¦²à§‡ à¦­à¦¾à¦² à¦¹à§Ÿà¥¤ à¦¨à¦¾ à¦¥à¦¾à¦•à¦²à§‡à¦“ à¦šà¦²à¦¬à§‡à¥¤</li>\n <li>KMP à¦à¦° Complexity Analysis!<strong><img alt=\"\" src=\"file/user_file/d23cceee2ef612873640798d6a86d4d18aa0c7aaee47f8a1100ea3f70b7fb504.jpg\" style=\"height:460px; width:460px\" /></strong></li>\n</ul>\n\n<h3><strong>Structure</strong></h3>\n\n<p>à¦¯à§‡à¦¹à§‡à¦¤à§ Data structure à¦Ÿà¦¾à¦° à¦¨à¦¾à¦® &ldquo;Palindromic Tree&rdquo;, à¦¤à¦¾à¦‡ à¦à¦‡à¦Ÿà¦¾à¦° à¦…à¦¬à¦¶à§à¦¯à¦‡ à¦à¦•à¦Ÿà¦¾ Tree à¦§à¦°à¦¨à§‡à¦° structure à¦¹à¦¬à§‡à¥¤ à¦…à¦¨à§à¦¯à¦¾à¦¨à§à¦¯ Tree à¦à¦° à¦®à¦¤ à¦à¦°à¦“ Node à¦¥à¦¾à¦•à¦¬à§‡, Edge à¦¥à¦¾à¦•à¦¬à§‡à¥¤</p>\n\n<p>à¦¸à¦¾à¦§à¦¾à¦°à¦£ Trie à¦à¦° à¦®à¦¤ à¦à¦–à¦¾à¦¨à§‡ à¦ªà§